import './PokeAbilities.css'

const PokeAbilities = () => {
    return (
    <div className='text2'>
        <p>Abilities</p>
        <span className='subtext'>
            <p>Stance Change</p>
        </span>
    </div>
    )
}

export default PokeAbilities
